webpackJsonp([0xfaf6bd22ef3a],{7155:function(e,t){e.exports={data:{post:{html:'<p>What, a Hamburg blogger meet not organized by Heiko and Nico? Why not..  <a title="Little Jamie - A nickel will get you on the subway, but garlic will get you a seat.*" href="http://www.littlejamie.com/entry.php?id=680">Jamie</a> and <a title="Heute mit dem leistungsfeindlichen Motto: Schön, daß Ihr da(bei)seid!" href="http://www.elfengleich.de/index.php?log_id=607">Elfe</a> have set the time and place: next Thursday, 16 December, Christmas Market at Gänsemärkt, starting at 6:00 pm, until whenever. The bloggers will be the ones drinking <em>Glühwein</em> to keep warm.</p>\n<p>(I can\'t say yet whether I can make it, since I\'m alone with Christopher that night.)</p>',fields:{title:"",date:"09 Dec 2004",url:"https://papascott.de/2004-12-09-hamburg-blogger-gluehwein-meet/"}}},pathContext:{slug:"/2004-12-09-hamburg-blogger-gluehwein-meet/",prev:{fields:{title:"The End",date:"08 Dec 2004",slug:"/2004-12-08-the-end/"}},next:{fields:{title:"I, for one, welcome our new feline overlords",date:"09 Dec 2004",slug:"/2004-12-09-i-for-one-welcome-our-new-feline-overlords/"}}}}}});
